import React from 'react';
import { render } from 'react-dom';

function Cities (props) {
    return (
        <div>
           <h1>City Name: {this.props.City}</h1>
           <p>{this.props.City.img}</p>
           <p>{this.props.City.state}</p>
           <p>{this.props.City.country}</p>

            })}
        </div>
    )
}

export default Cities;
